def basic_level(noun, recursive=True):
	noun = noun.lower()
	if noun in basic_levels:
		ret = basic_levels[noun]
		if ret != noun and basic_level(ret) != ret:
			return [ret] + basic_level(ret)
		else:
			return [ret]
	return ['entity']
